import React from 'react';
import SectorCard from './SectorCard';

const Zona = () => {
  return (
    <div className='container flex border-b-2 border-gray-400'>
      <div className='p-3 m-3'>
        <h1 className='text-xl'>Llayllay</h1>
        <h3>Valparaiso</h3>
        <SectorCard />
      </div>
    </div>
  );
};

export default Zona;
